) 接下来，让我们设计一下我们的 status，它表示实际看到的状态。它包含了我们希望用户或其他控制器能够轻松获得的任何信息。 我们将保存一个正在运行的 Jobs，以及我们最后一次成功运行 Job 的时间。注意，我们使用 metav1.Time 而不是 time.Time 来保证序列化的兼容性以及稳定性，如上所述。 // CronJobStatus defines the observed state of CronJob
type CronJobStatus struct { // INSERT ADDITIONAL STATUS FIELD - define observed state of cluster // Important: Run "make" to regenerate code after modifying this file // A list of pointers to currently running jobs. // +optional Active []corev1.ObjectReference `json:"active,omitempty"` // Information when was the last time the job was successfully scheduled. // +optional LastScheduleTime *metav1.Time `json:"lastScheduleTime,omitempty"`
} 最后，CronJob 和 CronJobList 直接使用模板生成的即可。如前所述，我们不需要改变这个，除了标记我们想要一个有状态子资源，这样我们的行为就像内置的 kubernetes 类型。 // +kubebuilder:object:root=true
// +kubebuilder:subresource:status // CronJob is the Schema for the cronjobs API
type CronJob struct { Root Object Definitions metav1.TypeMeta `json:",inline"` metav1.ObjectMeta `json:"metadata,omitempty"` Spec CronJobSpec `json:"spec,omitempty"` Status CronJobStatus `json:"status,omitempty"`
} // +kubebuilder:object:root=true // CronJobList contains a list of CronJob
type CronJobList struct { metav1.TypeMeta `json:",inline"` metav1.ListMeta `json:"metadata,omitempty"` Items []CronJob `json:"items"`
} func init() { SchemeBuilder.Register(&CronJob{}, &CronJobList{})
} 现在我们定义好了一个 API，我们需要编写一个控制器来实际实现这些功能。

